import jsPDF from "jspdf";
import { Cliente } from "./types";


const isDesktop = window.innerWidth >= 1024;

export function descargarDatos(clientes: Cliente[]) {  
    const blob = new Blob([JSON.stringify(clientes, null, 2)], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    if(isDesktop){
        a.download = 'BackupData-Desktop.json';
    } else {
        a.download = 'BackupData-Mobile.json';
    }
    a.click();
    URL.revokeObjectURL(url);
}

export function formatDatePretty(isoString: string) : string{
    const date = new Date(isoString)
    const formatter= new Intl.DateTimeFormat('es-ES', {
        year: 'numeric',
        month: 'long',
        day: 'numeric'
    })

    return formatter.format(date)
}


export function formatDate(date: Date | string | undefined): string {
    if (!date) return '';

    const dateObj = typeof date === 'string' ? new Date(date) : date;

    if (isNaN(dateObj.getTime())) {
        console.error('Invalid Date');
        return '';
    }

    const year = dateObj.getFullYear();
    const month = String(dateObj.getMonth() + 1).padStart(2, '0');
    const day = String(dateObj.getDate()).padStart(2, '0');

    return `${year}-${month}-${day}`;
}

export function formatCash(cash:string){
    return `$${cash}`
}

export const generateClientPDF = (data: Cliente) => {
    const doc = new jsPDF();
    const pageWidth = doc.internal.pageSize.getWidth();
    const imgWidth = 70; 
    const imgHeight = 42; 
    const x = (pageWidth - imgWidth) / 2;
    const maxWidth = 165;

    const logo = 
        `data:image/png;base64,`
    doc.addImage(logo, 'PNG', x, 20, imgWidth, imgHeight);

    // Configuración de fuente
    doc.setFont('Helvetica', 'bold');
    doc.setFontSize(20);
    doc.setTextColor(40, 40, 40);

    // Título
    doc.text('Información del Cliente', 105, 85, { align: 'center' });

    // Dibujar una línea debajo del título
    doc.setLineWidth(0.5);
    doc.line(20, 90, 190, 90);

    // Configurar fuente para el contenido
    doc.setFontSize(13);
    doc.setFont('Helvetica', 'normal');

    let startY = 105;
    const lineSpacing = 13;
  
    // Agrega los datos al PDF
    doc.text(`Nombre: ${data.nombre}`, 20, startY);
    doc.text(`Dirección: ${data.direccion}`, 20, startY + lineSpacing);
    doc.text(`Localidad: ${data.localidad}`, 20, startY + 2 * lineSpacing);

    doc.setFont('Helvetica', 'bold');
    doc.setFontSize(20);
    doc.setTextColor(40, 40, 40);

    // otro Título
    doc.text('Información del Servicio', 105, 150, { align: 'center' });

    // Dibujar una línea debajo del título
    doc.setLineWidth(0.5);
    doc.line(20, 155, 190, 155);

    doc.setFontSize(13);
    doc.setFont('Helvetica', 'normal');

    startY = 170; // Punto de partida para el contenido


    // Agrega los datos al PDF
    doc.text(`Precio: $${data.precio}`, 20, startY);

    // Incrementa `y` para la siguiente línea
    startY += lineSpacing;

    doc.text(`Fecha de la última revisión: ${data.ultimaVisita}`, 20, startY);

    // Incrementa `y` para la siguiente línea
    startY += lineSpacing;

    // Título de la descripción
    doc.text('Descripción del Servicio:', 20, startY);

    // Incrementa `y` para las líneas de la descripción
    startY += lineSpacing;

    // Ajustar el texto largo para que se envuelva en líneas
    const lines = doc.splitTextToSize(data.descripcion, maxWidth);

    // Iterar sobre cada línea y ajustarla
    lines.forEach((line: string | string[]) => {
    doc.text(line, 20, startY);
    startY += 8; // Incrementa `y` para cada línea
    });

    // Pie de página
    doc.setFontSize(10);
    doc.text(`Quique Frío - ${new Date().getFullYear()}`, 105, 285, { align: 'center' });
  
  
    // Descarga el PDF con el nombre del cliente
    doc.save(`Comprobante - ${data.nombre}.pdf`);
  };


